By default, the Jackson library does not call the `toString()` method on enums when serializing them. Instead, it serializes the enum using its name as defined in the enum declaration. 

For example, consider the following enum:

```java
public enum CashbackTransactionStatus {
    PENDING,
    COMPLETED,
    FAILED
}
```

When serialized with Jackson, an instance of `CashbackTransactionStatus.PENDING` would be serialized as `"PENDING"`.

However, if you want to customize the serialization of an enum, for example, to serialize it by its `toString()` method, you can use the `@JsonValue` annotation on the method that you want to be used for serialization. Here is how you can do it:

```java
public enum CashbackTransactionStatus {
    PENDING {
        @Override
        public String toString() {
            return "Pending Transaction";
        }
    },
    COMPLETED {
        @Override
        public String toString() {
            return "Completed Transaction";
        }
    },
    FAILED {
        @Override
        public String toString() {
            return "Failed Transaction";
        }
    };

    @JsonValue
    public String toJson() {
        return this.toString();
    }
}
```

With the above setup, Jackson will use the `toJson()` method (which calls the `toString()` method) for serialization.

