In Java, the naming convention for boolean getters can vary based on the context and the tool or framework being used. Typically, for boolean properties, the convention is to use the `is` prefix. However, there are circumstances where the `get` prefix might be used instead.

### Lombok and Getter Generation

When using Lombok's `@Getter` annotation, it defaults to generating a getter method with the `get` prefix, even for boolean fields, unless specified otherwise.

### Ensuring `is` Prefix for Boolean Getters

To ensure that Lombok generates a getter with the `is` prefix for a boolean field, you can explicitly set the `@Getter` annotation with a `boolean` parameter set to `true`. Here’s how you can do it:

```java
@AllArgsConstructor(access = PRIVATE)
public enum CashbackTransactionStatus {

    WAITING("Waiting", true),
    CREDITED("Credited", true),
    CANCELLED("Cancelled", true),
    TRANSFERRED("Transferred", false);

    private final String statusName;

    @Getter
    private final boolean allowedForCashback;

    public boolean isAllowedForCashback() {
        return this.allowedForCashback;
    }

    @Override
    public String toString() {
        return statusName;
    }
}
```

In this snippet, the `allowedForCashback` field has an explicitly declared getter with the `is` prefix. 

### Summary
By default, Lombok uses the `get` prefix for getters, including boolean fields. To align with the `is` prefix convention, you need to explicitly define the boolean getter method in your enum or class.

