```java
@Slf4j
@Service
@RequiredArgsConstructor
@FieldDefaults(level = PRIVATE, makeFinal = true)
public class DefaultCustomerRewardsService implements CustomerRewardsService {

    AssetClient assetClient;

    @Override
    public void processCustomerRewardCreation(CustomerRewardCreatedCommand command) {
        if (!command.getCashbackTransactionStatus().isAllowedForAsset()) {
            log.info("Customer reward creation is skipped due to status: {}", command.getCashbackTransactionStatus().name());
            return;
        }

        if (!command.getCashbackTransactionStatus().equals(WAITING)) {
            log.debug("Only {} status is expected, but was: {}", WAITING.name(), command.getCashbackTransactionStatus().name());
        }

        Asset asset = Asset.builder()
                .cashbackAllowed(true)
                .cashbackStatus(command.getCashbackTransactionStatus())
                .build();

        assetClient.updateAsset(command.getContractId(), asset);
        log.info("Updating asset with contract ID: {}, cashbackStatus: {}", command.getContractId(), asset.getCashbackStatus().name());
    }

}
